   c. Obstacle Avoidance Algorithms  
      • Use Vector Field Histogram (VFH): compute polar histogram from LIDAR/point cloud.  
      • Potential Field: define attractive force to goal and repulsive forces from obstacles.  
      • Dynamic Window Approach (DWA): simulate motion samples, score via clearance+velocity, choose best.  
      • Sample loop:
         ```
         while ~reached(goal)
           scan = readLidar(lidar);
           cost = computeDWA(scan, robotState, goal);
